import SimpleBarReact from 'simplebar-react';


export default function FocusedHistory({style}) {
  return (
    <div style={style.focusedHistoryContainer}>
      <div style={style.focusedSubTitle}>Profile History</div>

      <SimpleBarReact style={style.focusedHistoryContainer}>
        <div style={{textIndent: "5px", height: "88.5%"}}>
          <div>Add Content Here</div>
        </div>
      </SimpleBarReact>
    </div>
  )
}
